import React from "react";
import "../assets/styles/About.scss";

function About() {
  return (
    <div id="about">
      <div className="items-container">
        <h1>About</h1>
        <p>
          I’m a purpose-driven Software Engineer with 5+ years of experience across full-stack
          development, product engineering, and AI automation. I enjoy solving business
          problems and building scalable technology that drives real mesurable impact.
        </p>

        <p>My experience includes building and optimizing enterprise-grade REST APIs, developing
  inventory management and order tracking systems, and reducing manual effort through
  automation. I’ve also worked on agentic AI-based solutions to streamline workflows and
  improve operational efficiency.</p>

        <p>
        I’m known for clear communication, breaking down complex problems into actionable steps
        and collaborating effectively with stakeholders and cross-functional teams.
        </p>
      </div>
    </div>
  );
}

export default About;
